import React, { useEffect, useLayoutEffect, useRef, useState } from "react";
import "./edit.css";
import "./editProfil.css";
import "./editKategori.css";
import "./editOffice.css";
// import axios, { Axios } from "axios";
import Axios from "axios";
import Sectionimage from "./sectionimage";
import { useSelector, useDispatch } from "react-redux";
import { useNavigate } from "react-router-dom";
import { getMe} from "./auth";
import Navbar from "./navbar";
import Page from "./navbar";
import Crop from "./imageresize";
import Loader from "./loader";
import SectionTable from "./sectiontable";
import { Editor } from "@tinymce/tinymce-react";
import ReactQuill from "react-quill";
import "react-quill/dist/quill.snow.css";
import "./sectiontable.css";
import Office from "./office";
import Water from "./water";
import Profil from "./profil";

export default function Edit() {
  const { isError, isSuccess } = useSelector((state) => state.auth);
  const navigate = useNavigate();
  const dispatch = useDispatch();

  useEffect(() => {
    // console.log(isSuccess);
    dispatch(getMe());
  }, [dispatch]);

  useEffect(
    () => {
      // console.log(isError + " " + isSuccess);
      if (isError) {
        navigate("/");
      }
    },
    [isError]
  );

  return (
    <div className="editor">
        <>
          <Navbar />

          <div className="edit-container" id="editor">
            <Profil/>

            <SectionTable
              totalget="getkategori"
              getdb="getkategoribynama"
              getdbId="getkategoribyid"
              update="updatekategori"
              add="addkategori"
              delete="deletekategori"
              title="Kategori"
              nama="nama_kategori"
              gambar="gambar_kategori"
              id="id_kategori"
              tabletitle="Nama Kategori"
            />

            <Office />

            {/* <Sectionimage 
                        getdb = "getmitrabynama"
                        getdbId = "getmitrabyid"
                        update = "updatemitra"
                        add = "addmitra"
                        delete = "deletemitra"
                        title = "Mitra"
                        nama = "nama_mitra"
                        gambar = "gambar_mitra"
                        id = "ID_MITRA"
                    /> */}

            <SectionTable
              totalget="getmitra"
              getdb="getmitrabynama"
              getdbId="getmitrabyid"
              update="updatemitra"
              add="addmitra"
              delete="deletemitra"
              title="Mitra"
              nama="nama_mitra"
              gambar="gambar_mitra"
              id="ID_MITRA"
              tabletitle="Nama Mitra"
            />

            <SectionTable
              totalget="getpartner"
              getdb="getpartnerbynama"
              getdbId="getpartnerbyid"
              update="updatepartner"
              add="addpartner"
              delete="deletepartner"
              title="Partner"
              nama="nama_partner"
              gambar="gambar_partner"
              id="ID_PARTNER"
              tabletitle="Nama Partner"
            />

          </div>
        </>
    </div>
  );
}
